import React, { Component } from 'react'
import { Carousel } from 'react-bootstrap';
import logo from "../../../assets/images/sacgd.png";
export default class Services extends Component {
    render() {
        return (
            <>
                <div className='lore-ipm text-center mt-5 mb-5'>
                    <p>Lorem ipsum dolor</p>
                    <h1>Services</h1>
                </div>
                <Carousel
      slidesPerPage={5}
      slidesPerScroll={2}
      animationSpeed={1500}
      autoPlay={3000}
      stopAutoPlayOnHover
      offset={50}
      itemWidth={250}
      clickToChange
      centered
    >
      <img src={logo} />
      <img src={logo} />
      <img src={logo} />
      <img src={logo} />
      <img src={logo} />
      <img src={logo} />
    </Carousel>
            </>
        )
    }
}
